@workingrem A3: Itâ€™s complicated. I like to think of it like this:

Performance = (motivation X ability) - situational constraints

Where motivation/ability can compensate for each other, but when sever situational constraints arise, performance can be seriously reduced. #IOPsych

An article in the NY Times #OTD in 1937 announced the publication of the first issue of the Journal of Consulting Psychology. The first article, by noted psychological dilettante James McKeen Cattell, was titled: "What's a Slide Deck and Why Do You Need One?"

